    intro: "珠海市人民医院（暨南大学附属珠海医院/澳门科技大学医学院第一附属医院），创建于20世纪50年代，是集医疗、教学、科研、预防保健为一体的综合性三级甲等医院 [7]。\r\n1995年，珠海市人民医院被评定为三甲医院，2017年通过三甲复审，为珠海唯一省级区域医疗中心、珠海首个广东省高水平医院、全省公立医院改革与高质量发展示范单位。亦是同济大学教学医院、国家脑卒中筛查与防治示范基地医院、国家高级卒中中心、国家级胸痛中心、广东省放射介入医学质控中心挂靠单位、广东省转化医学创新平台单位（肿瘤微创诊疗）、澳门大学——珠海市人民医院精准医学研究中心、中央干部保健基地医院。2018年，成为全国首个同时通过“五星医院”认证和智慧医院HIC六级认证的医院。2019年，创建珠海首个5G智慧医院，并落地全国首个5G智慧医院海岛基地。“2019年全国三级公立医院绩效考核”评定等级A+，全国第116名，是珠海市唯一一家进入全国前10%的综合医院",
